const t=JSON.parse('{"key":"v-df8b6e0c","path":"/posts/tomato.html","title":"抽象类和接口的区别是什么","lang":"zh-CN","frontmatter":{"date":"2023-10-13T00:00:00.000Z","category":["Java基础"],"tag":["重要","面试"],"description":"抽象类和接口的区别是什么 抽象类的声明是abstract class 类名，接口的声明是public interface 接口名。 一个类只能继承一个抽象类，但是能实现多个接口。 接口主要是对类的行为进行约束，一个类实现某个接口也就拥有了对应的行为。抽象类主要用于代码复用，强调所属关系。 接口中的成员变量只能是public static final类型的，并且要有初始值，不能被修改。抽象类中的成员变量默认default，并且可以被重新赋值和修改。","head":[["meta",{"property":"og:url","content":"https://mister-hope.github.io/blogs/posts/tomato.html"}],["meta",{"property":"og:site_name","content":"Echo的学习之路"}],["meta",{"property":"og:title","content":"抽象类和接口的区别是什么"}],["meta",{"property":"og:description","content":"抽象类和接口的区别是什么 抽象类的声明是abstract class 类名，接口的声明是public interface 接口名。 一个类只能继承一个抽象类，但是能实现多个接口。 接口主要是对类的行为进行约束，一个类实现某个接口也就拥有了对应的行为。抽象类主要用于代码复用，强调所属关系。 接口中的成员变量只能是public static final类型的，并且要有初始值，不能被修改。抽象类中的成员变量默认default，并且可以被重新赋值和修改。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-10-14T10:35:29.000Z"}],["meta",{"property":"article:author","content":"Echo Hou"}],["meta",{"property":"article:tag","content":"重要"}],["meta",{"property":"article:tag","content":"面试"}],["meta",{"property":"article:published_time","content":"2023-10-13T00:00:00.000Z"}],["meta",{"property":"article:modified_time","content":"2023-10-14T10:35:29.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"抽象类和接口的区别是什么\\",\\"image\\":[\\"\\"],\\"datePublished\\":\\"2023-10-13T00:00:00.000Z\\",\\"dateModified\\":\\"2023-10-14T10:35:29.000Z\\",\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"Echo Hou\\",\\"url\\":\\"https://mister-hope.com\\"}]}"]]},"headers":[],"git":{"createdTime":1696827095000,"updatedTime":1697279729000,"contributors":[{"name":"houbingzhi123","email":"houbingzhi123@gmail.com","commits":4}]},"readingTime":{"minutes":0.57,"words":171},"filePathRelative":"posts/tomato.md","localizedDate":"2023年10月13日","excerpt":"<h1> 抽象类和接口的区别是什么</h1>\\n<p>抽象类的声明是<code>abstract class 类名</code>，接口的声明是<code>public interface 接口名</code>。</p>\\n<p>一个类只能继承一个抽象类，但是能实现多个接口。</p>\\n<p>接口主要是对类的行为进行约束，一个类实现某个接口也就拥有了对应的行为。抽象类主要用于<strong>代码复用</strong>，强调<strong>所属关系</strong>。</p>\\n<p>接口中的成员变量只能是<code>public static final</code>类型的，并且要有初始值，不能被修改。抽象类中的成员变量默认default，并且可以被重新赋值和修改。</p>","autoDesc":true}');export{t as data};
